    "The amount each additional upgrade requires will start increasing above 300,000 Tickspeed upgrades.": "每次额外升级所需的金额将开始增加，超过300000 计数频率 升级。",
    "per Tickspeed upgrade gained.": "每次获得 计数频率 升级。",
    "Next Tickspeed upgrade at": "下一次 计数频率 升级在",
    "Hold shift to see the Eternity Point cost for locked Time Dimensions.": "按住shift键查看未解锁时间维度的永恒点数成本。",
    "Any 8th Time Dimensions purchased above 1e8 will not further increase the multiplier.": "在1e8以上购买的任何 第 8 时间维度 都不会进一步增加乘数。",
    ", increasing by": ", 增加了",
    "and costs increase much faster after 1e6000 Eternity Points.": "并且在1e6000永恒点之后成本增加得更快。",
    "Exponentially rising matter divides the multiplier on all of your Antimatter Dimensions\n      once you have at least 1 2nd Antimatter Dimension.": "当你至少拥有第1个反物质维度时，指数上升的物质会将乘数除以所有反物质维度。",
    "Dimensional Sacrifice happens automatically every 400 milliseconds once you have\n      an 8th Antimatter Dimension.": "一旦你拥有第8个反物质维度，维度牺牲每400毫秒自动发生一次。",
    "Buying Antimatter Dimensions 1-4 causes all smaller Antimatter Dimension costs to increase.\n      Buying Antimatter Dimensions 5-8 causes all larger Antimatter Dimension costs to increase.": "购买反物质维度1-4会导致所有较小的反物质维度成本增加。\n购买反物质维度5-8会导致所有更大的反物质维度成本增加。",
    "An active Big Crunch Autobuyer will Crunch immediately when reaching an Infinity Challenge's antimatter goal, regardless of settings.": "无论设置如何，一个激活的 大坍缩 自动购买者在达到无限挑战的反物质目标时都会立即坍缩。",
    "Tickspeed upgrades are always ×1. For every Tickspeed upgrade purchase, you instead get a static\n      multiplier on all Antimatter Dimensions which increases based on Antimatter Galaxies.": "计数频率 升级总是×1。每购买一次 计数频率 升级，您将获得所有反物质维度的静态乘数，该乘数根据反物质星系而增加。",
    "Your production rapidly and continually drops down over time. Purchasing an Antimatter Dimension or Tickspeed\n        upgrade sets production back to 100% before it starts dropping again.": "随着时间的推移，您的产量会快速持续下降。购买反物质维度或 计数频率 \n升级会在产量再次下降之前将产量恢复到100%。",
    "Reward: You get a multiplier to Antimatter Dimensions 2-7 based on 1st and 8th Antimatter Dimension multipliers.": "奖励：根据第1和第8反物质维度乘数，你将获得反物质维度2-7的乘数。",
    "Reward: Infinity Dimension multiplier based on tickspeed": "奖励：基于 计数频率 的无限维度乘数",
    "All Normal Challenge restrictions are active at once, with the exception of the\n      Tickspeed (C9) and Big Crunch (C12) Challenges.": "除 计数频率（C9）和 大坍缩（C12）挑战外，所有正常挑战限制都会立即激活。",
    "All Infinity Challenges unlocked": "所有无限挑战已解锁",
    "Only the latest bought Antimatter Dimension's production is normal. All other Antimatter Dimensions\n      produce less (^0.25).": "只有最新购买的 反物质维度 的生产正常。所有其他“反物质维度”\n产生的值都较小（^0.25）。",
    "Reward: All Galaxies are 10% stronger and reduce the requirements for them\n        and Dimension Boosts by 1": "奖励：所有星系都增强了10%，并将它们和维度提升的要求降低1",
    "Reward: Antimatter Dimension multiplier based on Antimatter Galaxies and Tickspeed purchases": "奖励：基于反物质星系和 计数频率 购买的反物质维度乘数",
    "Reward: Dimension Boost multiplier is increased to a minimum of ×4": "奖励：维度提升倍数增加到最小值×4",
