    "All Dimension multipliers and powers are disabled except for the multipliers from\n      Infinity Power and Dimension Boosts (to Antimatter Dimensions).": "所有维度乘数和力量均被禁用，但来自无限力量和维度提升（到反物质维度）的乘数除外。",
    "All Infinity multipliers and generators are disabled. The goal must be reached within a certain\n      number of Infinities or else you will fail the Challenge.": "禁用所有无限乘数和生成器。必须在一定数量的无限数内达到目标，否则您将无法通过挑战。",
    "Antimatter Dimensions 5-8 don't produce anything. Dimensional Sacrifice is disabled.": "反物质维度5-8不会产生任何东西。维度牺牲已禁用。",
    "Complete Eternity Challenges again for a bigger reward, maximum of 5 times.": "再次完成永恒挑战，获得更大的奖励，最多5次。",
    "Distant Galaxy cost scaling starts later": "遥远的星系成本缩放在更晚开始",
    "Further reduce Antimatter Dimension cost multiplier growth": "进一步降低反物质维度成本乘数增长",
