    "Infinity Power strengthens Replicanti Galaxies": "无限力量强化复制星系",
    "Time Dimensions are disabled.": "时间维度被禁用。",
    "Time Dimensions and Infinity Dimensions are disabled. You gain an immense boost from\n        Infinities to Antimatter Dimensions (Infinities^950).": "时间维度和无限维度被禁用。 您从\n 无限到反物质维度 (无限^950) 获得巨大提升。",
    "When you respec out of an unlocked Eternity Challenge, you don't need to redo the secondary requirement": "当您从解锁的永恒挑战中重洗时，您无需重做次要要求",
    "You can only upgrade Infinity Dimensions 50 times and Replicanti\n      upgrades 40 times. Infinity Dimension and Replicanti upgrade autobuyers are disabled.": "您只能升级 无限维度 50次，复制品升级40次。无限维度 和复制品升级自动购买者已禁用。",
