    "Each Achievement has requirements to unlock. Once unlocked, some Achievements give a reward.\nRequirements and rewards vary in difficulty and benefit significantly.": "每个成就都有解锁要求。 解锁后，一些成就会给予奖励。\n要求和奖励的难度和收益各不相同。",
