    "EndOfSavefile": "保存文件结束",
    "Eternity is the second main reset layer. Reaching 1.80e308 Infinity Points\n      allows you to reset everything up to this point for access to new content and resources.": "永恒是第二个主要重置层。 达到 1.80e308 Infinity Points\n 后，您可以重置到目前为止的所有内容，以访问新的内容和资源。",
