    "Infinity Challenges are new challenges with an antimatter goal above\n      1.80e308. Completing them rewards upgrades and production boosts.": "无限挑战是新的挑战，其反物质目标高于\n 1.80e308。 完成它们会奖励升级和生产提升。",
    "Infinity Points are the primary resource after completing your first Infinity. They can be spent on\n      features which persist through Infinity resets.": "Infinity Points 是您完成第一个 Infinity 后的主要资源。 它们可以用于\n 在 Infinity 重置期间持续存在的功能。",
    "Instead of antimatter, the 1st Infinity Dimension produces Infinity Power, which gives a multiplier applied\nto all Antimatter Dimensions equal to (power": "第一个无限维度产生无限能量，而不是反物质，它提供了一个应用于\n所有反物质维度的乘数等于（功率",
