    "Just like your entire savefile, individual Automator scripts can be imported and exported from the game.\nProperly-formatted script strings will begin with": "就像您的整个存档文件一样，可以从游戏中导入和导出单个 Automator 脚本。\n格式正确的脚本字符串将以",
    "Max Galaxies:": "最大星系：",
