    "The developers of the game have announced that a new notation, \"Truest Blind\", will be released. They\n      report that it will remove the UI, allowing for a more streamlined user experience.": "游戏开发商宣布将发布新的符号“Truest Blind”。 他们报告称，它将删除 UI，从而提供更简化的用户体验。",
    "Why do they call it oven when you of in the cold food of out hot eat the food?": "当你在冷的食物或热的食物中吃东西时，为什么他们称其为烤箱？",
