    "Hey, you. You're finally awake. You were trying to get the 9th dimension, right? Walked right into that\n      Infinity, same as us, and that thief over there.": "嘿，你。 你终于醒了。 你试图获得第九维度，对吗？ 径直走进那个无限，和我们一样，还有那边的那个小偷。",
    "Note: All numbers on this page are intentionally unaffected by your notation settings": "注意：此页面上的所有数字均有意不受您的符号设置的影响",
    "In other unrelated news, we're getting reports that approximately 1.79 people are angry that lightning\n      is striking their Christmas tree at night.": "在其他不相关的新闻中，我们收到报告称，大约 1.79 人对夜间闪电击中他们的圣诞树感到愤怒。",
    "\"You can come up with the stupidest quote, credit it to some famous\n      person, and people will believe it.\" -Barack Obama": "“你可以想出最愚蠢的引言，把它归功于某个名人，人们就会相信它。”——巴拉克·奥巴马",
    ". Please contact your insurance to see if you are\n      covered. By continuing you absolve Antimatter Dimensions of blame should any of the above mentioned, or those\n      that have not been mentioned yet, occur to you. Antimatter Dimensions reserves the right to alter this at any\n      time, with or without warning.": "。 请联系您的保险公司以了解您是否在承保范围内。\n 如果您发生上述任何情况或尚未提及的情况，继续继续，您将免除反物质维度的责任。 反物质维度 保留随时更改此设置的权利，无论是否发出警告。",
    "Big tech companies have collaborated to create a new neural network that's trained in the generation of rap\n      lyrics, called RAP-3. First lyrical generations include \"Call me prometheus 'cuz I bring the fire\" and\n      \"Call me Sonic the way I'm gettin' these rings\". Critics say it still has a way to go before it replaces\n      traditional music.": "大型科技公司合作创建了一个新的神经网络，该网络经过训练来生成说唱歌词，称为 RAP-3。 第一代抒情歌曲包括“请叫我普罗米修斯，因为我带来了火”和“请叫我索尼克，就像我得到这些戒指的方式一样”。 批评者表示，它在取代传统音乐之前还有很长的路要走。",
    "Check out Avari's newly built actually infinite infinity pool! With an area of\n        Infinite square megametres, you'll be sure to have infinite fun!": "看看阿瓦里新建的实际上是无限的无边际泳池！ 面积为\n无限平方兆，您一定会享受到无限乐趣！",
    "Most things you know as nuts are actually Drupe seeds or Legumes. Hevipelle on the other hand is quite crazy\n      and can thus be considered a dry uncompartmented fruit.": "您所知道的大多数坚果实际上是核果种子或豆类。 另一方面，Hevipelle 则相当疯狂，因此可以被认为是一种干燥的无隔室水果。",
    "How many licks does it take to get to the center of an antimatter tootsie pop? A whole lot, because unless\n      you're made out of antimatter too, you'll explode every time you try to lick it.": "需要舔多少次才能到达反物质的中心？ 很多，因为除非你也是由反物质构成的，否则每次你试图舔它时都会爆炸。",
