    "@everyone": "@所有人",
    "\"If an alien lands on your front lawn and extends an appendage as a gesture of greeting, before you get\n      friendly, toss it an eightball. If the appendage explodes, then the alien was probably made of antimatter.\n      If not, then you can proceed to take it to your leader.\" -Neil deGrasse Tyson": "\"如果一个外星人降落在你的前草坪上并伸出一个附肢作为问候的手势，在你变得友好之前，\n 向它扔一个八号球。如果附肢爆炸，那么外星人可能是由反物质构成的。\n 如果不是 , 然后你可以继续把它带给你的领导。\" - Neil deGrasse Tyson",
    "Somebody told me to wait five hours for the update yesterday but it's today\n      and it still hasn't come! What do I do?": "昨天有人告诉我要等五个小时才能更新，但是今天\n 还是没有来！ 我该怎么办？",
    "Antimatter giraffes have incredibly fast reaction times. This explains why they've won 90% of\n    all gaming championships since anti-giraffe friendly controllers were invented.": "反物质长颈鹿的反应速度快得令人难以置信。 这就解释了为什么他们赢得了 90%\n 自反长颈鹿友好型控制器发明以来的所有游戏冠军。",
    "Hello, this is your local always reliable news source, and today people are taking over the streets\n        as they fight over which Infinity Challenge is worse. Finally, let's chat with this woman who doesn't seem to be in either side. What's your opinion on the\n          matter? \"Personally, I thought Tickspeed Autobuyer Challenge was worse than both-\" \"GET HER!!\" \"WAIT NO-\"\n          Well, seems like this just took a turn, so I'm getting as far away as I possibly can. This is your local\n          news host, and we'll come back with further information... someday.": "您好，这是您当地始终可靠的新闻来源，今天人们正在占领街道\n，因为他们为哪个无限挑战更糟糕而争论不休。 最后再聊聊这位似乎两边都不在的女人。 你对这件事\n有什么看法？ \“就我个人而言，我认为 计数频率 自动购买者挑战 比两者都差-\” \“抓住她！！\” \“等等- \”\n 好吧，好像这只是转了一圈，所以我已经走了这么远 尽我所能。 这是您当地的\n 新闻主持人，我们会回来提供更多信息......总有一天。",
    "Doesn't want to hurt you": "不想伤害你",
    "If you are not playing on Kongregate, Steam, or https://ivark.github.io/AntimatterDimensions/,\n      the site is bootleg.": "如果您不在 Kongregate、Steam 或 https://ivark.github.io/AntimatterDimensions/ 上玩游戏，\n 该网站是盗版网站。",
    "Computer scientists are outraged, \"What even are Infinity Points? IP stands for Internet Protocol!\".\n      Debates continue to intensify, more at 7.": "计算机科学家们感到愤怒，“无限点是什么？IP代表互联网协议！”。\n争论继续加剧，在7岁时更加激烈。",
    "mmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmm Oh sorry, wrong text field.": "mmmmmmmmmm2mmmmmmmm mmmmmm-mmmmmmmmmmmmmmMMmmmmmmmm2抱歉，文本字段错误。",
    "Pokemon Reality and Infinity were just released! This new generation brings the total number of Pokemon up to 1e151. Good luck catching 'em all!": "口袋妖怪现实和无限刚刚发布！新一代口袋妖怪的总数达到了1e151。祝你好运，抓住他们！",
